import sys
import os
import base64
from PyQt5.QtWidgets import (
    QApplication, QWidget, QVBoxLayout, QLabel, QLineEdit, QPushButton,
    QFileDialog, QMessageBox, QProgressBar, QListWidget, QHBoxLayout,
    QCheckBox, QGraphicsView, QGraphicsScene, QGraphicsPixmapItem
)
from PyQt5.QtGui import QIcon, QPixmap, QImage
from PyQt5.QtCore import QByteArray, Qt

class ImageRenamer(QWidget):
    def __init__(self):
        super().__init__()
        self.initUI()

    def initUI(self):
        self.setWindowTitle("SimpleWImage")
        self.setGeometry(100, 100, 800, 600)

        icon_base64 = """"""
        icon_data = base64.b64decode(icon_base64)
        pixmap = QPixmap()
        pixmap.loadFromData(QByteArray(icon_data))
        self.setWindowIcon(QIcon(pixmap))

        # Layout principal
        main_layout = QVBoxLayout()

        # Botón para seleccionar imágenes
        self.select_files_button = QPushButton("Select Image Files")
        self.select_files_button.clicked.connect(self.select_files)
        main_layout.addWidget(self.select_files_button)

        # Lista de archivos seleccionados y vista previa
        file_preview_layout = QHBoxLayout()
        self.file_list = QListWidget()
        self.file_list.itemSelectionChanged.connect(self.preview_image)
        file_preview_layout.addWidget(self.file_list)

        self.image_preview = QGraphicsView()
        self.image_scene = QGraphicsScene()
        self.image_preview.setScene(self.image_scene)
        file_preview_layout.addWidget(self.image_preview)

        main_layout.addLayout(file_preview_layout)

        # Campo para prefijo
        self.prefix_label = QLabel("Enter prefix for new file names:")
        main_layout.addWidget(self.prefix_label)
        self.prefix_input = QLineEdit()
        main_layout.addWidget(self.prefix_input)

        # Opciones adicionales
        self.keep_original_checkbox = QCheckBox("Keep original files")
        main_layout.addWidget(self.keep_original_checkbox)

        # Botón para seleccionar carpeta de exportación
        self.export_folder_button = QPushButton("Select Export Folder")
        self.export_folder_button.clicked.connect(self.select_export_folder)
        main_layout.addWidget(self.export_folder_button)

        self.export_folder_label = QLabel("Export folder: Not selected")
        main_layout.addWidget(self.export_folder_label)

        # Botón para iniciar renombrado
        self.rename_button = QPushButton("Rename and Export Files")
        self.rename_button.clicked.connect(self.rename_files)
        main_layout.addWidget(self.rename_button)

        # Barra de progreso
        self.progress_bar = QProgressBar()
        main_layout.addWidget(self.progress_bar)

        # Configurar el layout principal
        self.setLayout(main_layout)

        # Aplicar estilo oscuro con texto amarillo, detalles rojos y azules
        self.setStyleSheet("""
            QWidget {
                background-color: #2e2e2e;
                color: yellow;
            }
            QLabel {
                color: yellow;
            }
            QLineEdit {
                background-color: #4a4a4a;
                color: yellow;
                border: 1px solid red;
            }
            QPushButton {
                background-color: #3a3a3a;
                color: yellow;
                border: 1px solid blue;
                padding: 5px;
            }
            QPushButton:hover {
                background-color: #555555;
            }
            QListWidget {
                background-color: #4a4a4a;
                color: yellow;
                border: 1px solid blue;
            }
            QProgressBar {
                background-color: #555555;
                color: yellow;
                border: 1px solid red;
            }
            QProgressBar::chunk {
                background-color: blue;
            }
        """)

    def select_files(self):
        files, _ = QFileDialog.getOpenFileNames(self, "Select Image Files", "", "Image Files (*.png *.jpg *.jpeg *.bmp *.gif)")
        if files:
            self.selected_files = files
            self.file_list.clear()
            self.file_list.addItems(files)

    def preview_image(self):
        selected_items = self.file_list.selectedItems()
        if selected_items:
            file_path = selected_items[0].text()
            image = QImage(file_path)
            if not image.isNull():
                pixmap = QPixmap.fromImage(image)
                self.image_scene.clear()
                self.image_scene.addPixmap(pixmap)
                self.image_preview.fitInView(self.image_scene.itemsBoundingRect(), Qt.KeepAspectRatio)

    def select_export_folder(self):
        folder = QFileDialog.getExistingDirectory(self, "Select Export Folder")
        if folder:
            self.export_folder_label.setText(f"Export folder: {folder}")
            self.export_folder = folder

    def rename_files(self):
        if not hasattr(self, 'selected_files') or not self.selected_files:
            QMessageBox.warning(self, "Warning", "Please select image files first.")
            return
        if not hasattr(self, 'export_folder'):
            QMessageBox.warning(self, "Warning", "Please select an export folder first.")
            return
        prefix = self.prefix_input.text()
        if not prefix:
            QMessageBox.warning(self, "Warning", "Please enter a prefix for the file names.")
            return

        total_files = len(self.selected_files)
        self.progress_bar.setMaximum(total_files)
        for i, file_path in enumerate(self.selected_files, start=1):
            file_name = os.path.basename(file_path)
            file_extension = os.path.splitext(file_name)[1]  # Obtener la extensión del archivo
            new_name = f"{prefix}_{i:03d}{file_extension}"
            new_path = os.path.join(self.export_folder, new_name)

            if self.keep_original_checkbox.isChecked():
                try:
                    import shutil
                    shutil.copy(file_path, new_path)
                except Exception as e:
                    QMessageBox.warning(self, "Error", f"Could not copy file {file_name}: {e}")
            else:
                try:
                    os.rename(file_path, new_path)
                except Exception as e:
                    QMessageBox.warning(self, "Error", f"Could not rename file {file_name}: {e}")

            self.progress_bar.setValue(i)

        QMessageBox.information(self, "Success", f"Processed {total_files} files successfully.")
        self.reset_fields()

    def reset_fields(self):
        self.file_list.clear()
        self.prefix_input.clear()
        self.export_folder_label.setText("Export folder: Not selected")
        self.progress_bar.setValue(0)
        if hasattr(self, 'selected_files'):
            del self.selected_files
        if hasattr(self, 'export_folder'):
            del self.export_folder

if __name__ == '__main__':
    app = QApplication(sys.argv)
    renamer = ImageRenamer()
    renamer.show()
    sys.exit(app.exec_())
